import React, { Component } from 'react';

import Head from 'next/head';

class Partners extends Component {
    UNSAFE_componentWillMount() {
        console.log("Props: ", this.props.partnersObj);
    }
    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="partners">
                    <div className="container">
                        <div className="intro">
                            <h1>Partner with the Most Complete Practice Management & EMR Solution in the Industry</h1>
                            <p>Aesthetic Record is trusted by practices of all sizes to manage patient interactions and day-to-day operations</p>
                        </div>
                    </div>
                    <div className="logos-holder">
                        <div className="container">
                            <ul>
                                <li><img src="images/logo01.png" alt="Image description" /></li>
                                <li><img src="images/logo02.png" alt="Image description" /></li>
                                <li><img src="images/logo03.png" alt="Image description" /></li>
                                <li><img src="images/logo04.png" alt="Image description" /></li>
                                <li><img src="images/logo05.png" alt="Image description" /></li>
                                <li><img src="images/logo06.png" alt="Image description" /></li>
                                <li><img src="images/logo07.png" alt="Image description" /></li>
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Partners;
